import React from 'react';
import logo from './logo.svg';
import './App.css';
import './views/dashboard/dashboard'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Dashboard/>
    </div>
  );
}

export default App;
